import React from 'react';

import Button from '../../UI/Button/Button';
import Phone from './Phone/Phone';
import styles from './NavContacts.module.css';

function navContacts() {
  return (
    <div className={styles.contacts}>
      <p>Company Name</p>
      <Phone />

      <p>
        <svg version="1" width='14' height='14' xmlns="http://www.w3.org/2000/svg" viewBox="0 0 578 578"><path d="M48.58,0C21.793,0,0,21.793,0,48.58s21.793,48.58,48.58,48.58s48.58-21.793,48.58-48.58S75.367,0,48.58,0z M48.58,86.823 c-21.087,0-38.244-17.155-38.244-38.243S27.493,10.337,48.58,10.337S86.824,27.492,86.824,48.58S69.667,86.823,48.58,86.823z"/><path d="M73.898,47.08H52.066V20.83c0-2.209-1.791-4-4-4c-2.209,0-4,1.791-4,4v30.25c0,2.209,1.791,4,4,4h25.832 c2.209,0,4-1.791,4-4S76.107,47.08,73.898,47.08z"/></svg>
        Mon - Fri: 9 - 5, Sat 9 - 2
      </p>

      <Button type='button'>Заказать Звонок</Button>
    </div>
  )
}

export default navContacts
